        var wDuration = new Array(); ##work duration values
        var wDurationCoeff = new Array(); ##work duration values with coeff
        var wDurationLabel = new Array(); ## x-axis for line charts, x label for bars
        var wDurationCoeffLabel = new Array(); ## x-axis for line charts, x label for bars
        var weekLabel = new Array(); ## x-label for line charts
        var i=0;
        #set($columnColor = '"#01DF01",') ##Column color for coeff data (when coeff is displayed)
        #foreach($item in $wDuration.keySet())
          #set($soldId = $wDuration["$item"].size() - 1) ##Used to get sold data whatever is the type of graph (always the last column)
          ##Putting data into javascript variables
          #if($type == 0) ##Bar chart per user type
            #set($graphTitle = "Work done per user type ($unit)")
            #set($label = $services.localization.render("prj.usertypes.$item"))
            #set($soldY = ", wSoldY ")
            #set($soldX = ", wDurationCoeffLabel ")
            wSoldX[i] = '$item';
            wDurationLabel[i] = '$label';
            wDurationCoeffLabel[i] = ' '; 
            wSoldY[i] = $!wDuration[$item].get($soldId);
          #elseif($type == 1) ##Bar chart per employee
            #set($graphTitle = "Work done per employee ($unit)")
            #set($userDoc = $xwiki.getDocument($item))
            #if($item == "zztotal") ##Name of total column with "zz" to sort the map easily
              #set($label = $services.localization.render("prj.usertypes.$item"))
            #else
              #set($label = $xwiki.getUserName($item, false))
            #end
            wDurationCoeffLabel[i] = ' ';
            wDurationLabel[i] = '$label';
          #else ##Line chart (work by week cumulative)
            #if($item.indexOf('-') != -1)
              #set($label = $item.split('-').get(1))
            #else
              #set($label = $item)
            #end
            #set($labelCoeff = $label)
            wSoldX[i] = i;
            wSoldY[i] = $!wDuration[$item].get($soldId);
            #set($progressId = $soldId - 1)
            progressY[i] = $!wDuration[$item].get($progressId);
            wDurationLabel[i] = i;
            wDurationCoeffLabel[i] = i;
            //x-value must be a number so weekLabel is the 'year-week' string value
            weekLabel[i] = '$item';
            #set($scaleLineY = "scaleY, ")
            #set($soldY = ", progressY, wSoldY ")
            #set($soldX = ", wSoldX ")
          #end
          wDuration[i] = $wDuration[$item].get(0);
          #if($xwiki.exists('EmployeesCosts.EmployeesCostsClass'))
            wDurationCoeff[i] =  $wDuration[$item].get(1);
            #set($durationCoeff = ', wDurationCoeff')
            #set($durationCoeffLabel = ', wDurationCoeffLabel')
          #end
          i++;
        #end
        #if($type == 2)
          var scaleY = [0, Math.ceil(wSoldY[i-1]/10)*10];
          var scaleX = [wSoldX[0], wSoldX[wSoldX.length - 1]];
