        r2.text(720, 450, "Week of year").attr(txtattr);
        var lines = r2.linechart(
          30, 30, ##position (x, y)
          750, 400, ##width, height
          dataListX, ##x-values
          dataListY, ##y-values
          {
            nostroke: false,
            axis: "0 0 1 1",
            axisxstep: 2,
            symbol: "circle",         // draw the lines dashed
             colors: [
               "transparent",    // the third line is invisible
               "green",       // the first line is blue
               $columnColor
               "lightblue" ,
               "blue"
             ]
          }).hoverColumn(function () {
              this.tags = r2.set();
              var iSold = this.y.length - 1;
              var iDiff = iSold - 1;
              for (var i = 1, ii = this.y.length; i < ii; i++) {
                this.tags.push(r2.popup(this.x, this.y[i], this.values[i]+' $unit', 'up').insertBefore(this));
              }
              this.tags.push(r2.flag(850, 20, 'Diff: '+Math.round(10*(this.values[iSold]-this.values[iDiff]))/10+' $unit', 0).insertBefore(this));
              this.tags.push(r2.flag(850, 40, 'Progress: '+Math.round(100*(this.values[iDiff]/this.values[iSold]))+' %', 0).insertBefore(this));
              }, function () {
                this.tags && this.tags.remove();
        });
        var axisItems = lines.axis[0].text.items;
        for( var i = 0, l = wSoldX.length; i < l; i++ ) {
          axisItems[i].attr("text", weekLabel[i]); ##x-values = week numbers only
